import { Table } from "reactstrap";
// import { getEventList } from "../lib/utility";
import {fetchAPI} from '../lib/utility';
export default (allEventData) => {  
    allEventData.map((e) => {
        return(
            <tr>
                <td>{e.purpose}</td>
                <td>{e.conducted_on}</td>
                <td>{e.details}</td>
            </tr>
        );
    });
  return (
    <div>
      <Table striped>
        <thead>
            <tr>
            <th>Purpose of Event</th>
            <th>Date and Time of Event</th>
            <th>details</th>
            </tr>
        </thead>
        <tbody>
            {}
        </tbody>
        </Table>
    </div>
  );
};


export async function getStaticProps() {
    const allEventData = await fetchAPI('/events');
    // console.log(typeof(allEventData));
    // console.log(allEventData[0]);
    return {
      props: {
        allEventData
    },
    }
  }
